=head1 FUNCTIONS

=head2 as_html_img

Returns an inline HTML image. For now, it just works with
Netscape/Gecko based browsers.

=cut

sub as_html_img {
   my $cc = shift;
   if (exists($FLAGS{$cc})) {
      return "<img alt=\"$cc\" src=\"data:image/gif;base64,$FLAGS{$cc}\"/>";
   } else {
      return undef;
   }
}

=head2 as_gif

Returns the gif code. Normally used as:

  open GIF, ">image.gif";
  print GIF as_gif("PT");
  close GIF;

=cut

sub as_gif {
  my $cc = shift;
  if (exists($FLAGS{$cc})) {
    return decode_base64($FLAGS{$cc});
  } else {
    return undef;
  }
}

